import React from 'react'

import products from '../product'

const Homescreen = () => {
    return (
        <>
            <h1>Latest Product</h1>
            <div className="row">
                {products.map(product => (
                    <div className="col-md-3">
                        <Product product={product}/>
                    </div>
                ))}

            </div>
        </>
    )
}

export default Homescreen
